class Solution {

    /**
     * @param String $s1
     * @param String $s2
     * @param String $s3
     * @return Integer
     */
    function findMinimumOperations($s1, $s2, $s3) {
        // The goal is to make all strings equal with the minimum number of operations
        // by removing characters from the end. If at any point, the remaining substrings
        // of s1, s2, and s3 are equal, we calculate the total operations taken.

        $len1 = strlen($s1);
        $len2 = strlen($s2);
        $len3 = strlen($s3);

        // Calculate the total length of all strings to find the total number of deletions required.
        $totalLength = $len1 + $len2 + $len3;

        // Find the longest common suffix for all three strings because that's what they'll eventually need to match.
        $i = 0;
        while ($i < $len1 && $i < $len2 && $i < $len3) {
            if ($s1[$len1 - $i - 1] == $s2[$len2 - $i - 1] && $s2[$len2 - $i - 1] == $s3[$len3 - $i - 1]) {
                $i++;
            } else {
                break;
            }
        }

        // The number of operations is the total length of all strings minus three times the length of the common suffix.
        // Since we're looking for the minimum number of operations to make all strings equal, if there's no common suffix,
        // it's impossible to make them equal with any number of operations.
        if ($i == 0) { // No common suffix, cannot make strings equal.
            return -1;
        }

        // The minimum number of operations is the sum of the differences in length from each string to the common suffix.
        return $totalLength - 3 * $i;
    }
}
